 modern applications on Kubernetes infrastructure.', params: SamplingParams(n=1, presence_penalty=0.0, frequency_penalty=0.0, repetition_penalty=1.0, temperature=0.0, top_p=1.0, top_k=-1, min_p=0.0, seed=None, stop=[], stop_token_ids=[], bad_words=[], include_stop_str_in_output=False, ignore_eos=False, max_tokens=20, min_tokens=0, logprobs=None, prompt_logprobs=None, skip_special_tokens=True, spaces_between_special_tokens=True, truncate_prompt_tokens=None, guided_decoding=None, extra_args=None), prompt_token_ids: [128000, 11435, 1698, 58780, 84, 5825, 264, 1396, 315, 7526, 323, 3600, 430, 54263, 433, 505, 1202, 28650, 11, 1778, 439, 480, 3472, 323, 469, 41549, 13, 5810, 527, 1063, 315, 279, 7526, 323, 3600, 430, 58780, 84, 5825, 430, 527, 539, 2561, 389, 1521, 15771, 1473, 16, 13, 58780, 84, 7473, 5475, 320, 70614, 393, 344, 2426, 15161, 12595, 894, 1680, 58780, 84, 5825, 264, 9624, 15971, 5452, 369, 4857, 11, 61417, 11, 323, 18646, 8522, 11, 902, 5825, 264, 810, 75160, 323, 28598, 5603, 311, 3851, 4500, 323, 24047, 7863, 311, 8776, 67474, 6108, 20414, 627, 17, 13, 58780, 84, 24098, 7935, 25, 58780, 84, 5825, 264, 58983, 6373, 5452, 369, 18646, 5361, 67474, 28066, 4028, 2204, 22484, 323, 14054, 12850, 13, 1115, 5825, 264, 810, 43790, 323, 75160, 5603, 311, 18646, 67474, 28066, 1109, 18646, 1124, 32399, 627, 18, 13, 58780, 84, 5475, 26179, 25, 58780, 84, 5825, 264, 2532, 11546, 430, 5825, 24035, 11, 2585, 11, 323, 4868, 369, 8162, 13069, 6108, 8522, 4401, 389, 67474, 11, 902, 374, 539, 2561, 389, 480, 3472, 477, 469, 41549, 13, 1102, 5825, 4519, 1778, 439, 9629, 6373, 11, 2532, 18841, 11, 323, 4868, 627, 19, 13, 58780, 84, 31943, 2968, 25, 58780, 84, 5825, 264, 5507, 369, 16967, 323, 69771, 8522, 4401, 389, 67474, 14054, 11, 902, 5825, 264, 810, 16195, 1684, 315, 3851, 5178, 7863, 311, 279, 16967, 17357, 3984, 555, 480, 3472, 477, 469, 41549, 627, 20, 13, 58780, 84, 67474, 10810, 50521, 14398, 25, 58780, 84, 5825, 264, 67474, 8141, 430, 374, 34440, 369, 4401, 389, 34